import React from 'react';

const Services = () => {
    return (
        <div>
            <h1>Our Services</h1>
            <p>We offer a variety of services to meet your needs:</p>
            <ul>
                <li>
                    <h2>Consulting</h2>
                    <p>Expert advice to help you navigate your challenges.</p>
                </li>
                <li>
                    <h2>Development</h2>
                    <p>Custom software solutions tailored to your requirements.</p>
                </li>
                <li>
                    <h2>Support</h2>
                    <p>Ongoing support to ensure your systems run smoothly.</p>
                </li>
            </ul>
        </div>
    );
};

export default Services;
